INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (1, 1, 40011, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 2, 24001, 0, "リリ", 125801, 321, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (2, 1, 40011, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 2, 24001, 0, "クリア", 126001, 322, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (3, 1, 40011, "んーと。\nこれ、あげる。\nはい", 2, 24001, 0, "プレシア", 126101, 323, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (4, 2, 40011, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 2, 24001, 0, "リリ", 125801, 324, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (5, 2, 40011, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 2, 24001, 0, "クリア", 126001, 325, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (6, 2, 40011, "お兄。\nきてくれて、うれしい", 2, 24001, 0, "プレシア", 126101, 326, 1);
